import React from 'react'
import { banner } from '../assets/images'

const Homepage = () => {
  return (
    <section className='relative max-container h-[80vh]'>
        <img className='absolute h-full  w-full object-center' src={banner} alt="" />
        <div className='absolute left-[15%] top-[10%]'>
          <h1 className='font-bold text-4xl text-red-600'>Trending Outfits at Super Values</h1>

        </div>
    </section>
  )
}

export default Homepage
